MrXL allows us to parallelize our map operations. Consider a variation on our prior example: input avec: int[4]
output squares: int[4]
squares := map 2 (a <- avec) { a * a } The noteworthy change is the parallelism factor of the map operation. The parallelism factor 2 specifies that two copies of the loop bodies should be executed in parallel. Our implementation automatically generates code that takes advantage of memory banking in the supplied data. This allows for parallel accesses. It also creates an obligation on the data-supply side; we will show how to discharge this shortly. At a high level, we can change the compilation of the map operation to produce two copies of the hardware we generated above. We can generate a control program that looks like: par { while le_b0.out with cond_b0 { seq { eval_body_b0; incr_idx_b0; } } while le_b1.out with cond_b1 { seq { eval_body_b1; incr_idx_b1; } }
} The par operator executes all the loops in parallel. The complete implementation shows the necessary code to accomplish this which simply creates an outer loop to generate distinct hardware for each copy of the loop.

