A component's cells section instantiates a set of sub-components. It contains a list of declarations with this syntax: [ref]? <name> = <comp>(<param...>); Here, <comp> is the name of an existing primitive or component definition , and <name> is the fresh, local name of the instance. The optional ref parameter turns the cell into a by-reference cell . Parameters are only allowed when instantiating primitives, not Calyx-defined components. For example, the following definition of the counter component instantiates a std_add and std_reg primitive as well as a foo Calyx component component foo() -> () { ... }
component counter() -> () { cells { r = std_reg(32); a = std_add(32); f = foo(); } wires { ... } control { ... }
} When instantiating a primitive definition , the parameters are passed within the parenthesis. For example, we pass 32 for the WIDTH parameter of the std_reg in the above instantiation. Since an instantiation of a Calyx component does not take any parameters, the parameters are always empty.

