The JSON-based data format allows us to provide inputs for a memory and specify how the values should be interpreted: { "mem": { "data": [10], "format": { "numeric_type": "bitnum", "is_signed": false, "width": 32 } }
} The data field represents the initial data for the memory and can use mutlidimensional arrays to describe it. For example, the following is the initial data for a two-dimensional (std_mem_d2) memory: { "data": [ [1, 2], [3, 4] ], "format": {...}
} The format specifier tells fud how to interpret the values in the data field. The original program specifies that all values should be treated as 32-bit, unsigned values. In order to specify fixed-point values, we must specify both the total width and fraction widths: "root": { "data": [ 0.0 ], "format": { "numeric_type": "fixed_point", "is_signed": false, "width": 32, "frac_width": 16 }
} The format states that all values have a fractional width of 16-bits while the remainder is used for the integral part. Note: fud requires that for each memory marked with the @external attribute in the program.

